import React, { useState, useEffect } from 'react';
import { Database, FileText, Settings, Play, RotateCcw, Eye, Download } from 'lucide-react';
import DatabaseNormalization from '../components/phase2/DatabaseNormalization';
import StatuteNameNormalizer from '../components/phase2/StatuteNameNormalizer';
import StructureCleaner from '../components/phase2/StructureCleaner';
import SortingInterface from '../components/phase2/SortingInterface';
import ProgressTracker from '../components/phase2/ProgressTracker';
import ResultsPreview from '../components/phase2/ResultsPreview';
import NormalizationHistory from '../components/phase2/NormalizationHistory';

const Phase2: React.FC = () => {
  const [activeTab, setActiveTab] = useState('overview');
  const [normalizationStatus, setNormalizationStatus] = useState<any>(null);
  const [isLoading, setIsLoading] = useState(false);

  const tabs = [
    { id: 'overview', name: 'Overview', icon: Database, description: 'Normalization dashboard and status' },
    { id: 'normalization', name: 'Normalization', icon: Settings, description: 'Execute normalization process' },
    { id: 'statute-names', name: 'Statute Names', icon: FileText, description: 'Clean and standardize names' },
    { id: 'structure', name: 'Structure', icon: Settings, description: 'Clean database structure' },
    { id: 'sorting', name: 'Sorting', icon: FileText, description: 'Alphabetical sorting tools' },
    { id: 'progress', name: 'Progress', icon: Play, description: 'Track normalization progress' },
    { id: 'results', name: 'Results', icon: Eye, description: 'Preview normalized data' },
    { id: 'history', name: 'History', icon: RotateCcw, description: 'Process history and audit' }
  ];

  useEffect(() => {
    // Load initial normalization status
    fetchNormalizationStatus();
  }, []);

  const fetchNormalizationStatus = async () => {
    try {
      const response = await fetch('/api/v1/phase2/normalization-status');
      const data = await response.json();
      if (data.success) {
        setNormalizationStatus(data.status);
      }
    } catch (error) {
      console.error('Failed to fetch normalization status:', error);
    }
  };

  const handleTabChange = (tabId: string) => {
    setActiveTab(tabId);
  };

  const renderTabContent = () => {
    switch (activeTab) {
      case 'overview':
        return (
          <div className="space-y-6">
            {/* Status Overview */}
            <div className="bg-white rounded-lg shadow p-6">
              <h2 className="text-xl font-semibold text-gray-900 mb-4">Normalization Status</h2>
              {normalizationStatus ? (
                <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-4">
                  <div className="bg-blue-50 p-4 rounded-lg">
                    <div className="flex items-center">
                      <Database className="h-8 w-8 text-blue-600" />
                      <div className="ml-3">
                        <p className="text-sm font-medium text-blue-900">Raw Statutes</p>
                        <p className="text-2xl font-bold text-blue-600">{normalizationStatus.raw_statutes_count.toLocaleString()}</p>
                      </div>
                    </div>
                  </div>
                  
                  <div className="bg-green-50 p-4 rounded-lg">
                    <div className="flex items-center">
                      <FileText className="h-8 w-8 text-green-600" />
                      <div className="ml-3">
                        <p className="text-sm font-medium text-green-900">Normalized</p>
                        <p className="text-2xl font-bold text-green-600">{normalizationStatus.normalized_statutes_count.toLocaleString()}</p>
                      </div>
                    </div>
                  </div>
                  
                  <div className="bg-purple-50 p-4 rounded-lg">
                    <div className="flex items-center">
                      <Settings className="h-8 w-8 text-purple-600" />
                      <div className="ml-3">
                        <p className="text-sm font-medium text-purple-900">Cleaned</p>
                        <p className="text-2xl font-bold text-purple-600">{normalizationStatus.cleaned_statutes_count.toLocaleString()}</p>
                      </div>
                    </div>
                  </div>
                  
                  <div className="bg-orange-50 p-4 rounded-lg">
                    <div className="flex items-center">
                      <FileText className="h-8 w-8 text-orange-600" />
                      <div className="ml-3">
                        <p className="text-sm font-medium text-orange-900">Sorted</p>
                        <p className="text-2xl font-bold text-orange-600">{normalizationStatus.sorted_statutes_count.toLocaleString()}</p>
                      </div>
                    </div>
                  </div>
                </div>
              ) : (
                <div className="text-center py-8">
                  <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-primary-600 mx-auto mb-4"></div>
                  <p className="text-gray-600">Loading normalization status...</p>
                </div>
              )}
            </div>

            {/* Quick Actions */}
            <div className="bg-white rounded-lg shadow p-6">
              <h2 className="text-xl font-semibold text-gray-900 mb-4">Quick Actions</h2>
              <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
                <button
                  onClick={() => setActiveTab('normalization')}
                  className="flex items-center justify-center p-4 border-2 border-dashed border-gray-300 rounded-lg hover:border-primary-500 hover:bg-primary-50 transition-colors"
                >
                  <Play className="h-8 w-8 text-primary-600 mr-3" />
                  <div className="text-left">
                    <p className="font-medium text-gray-900">Start Normalization</p>
                    <p className="text-sm text-gray-600">Begin the complete process</p>
                  </div>
                </button>
                
                <button
                  onClick={() => setActiveTab('results')}
                  className="flex items-center justify-center p-4 border-2 border-dashed border-gray-300 rounded-lg hover:border-primary-500 hover:bg-primary-50 transition-colors"
                >
                  <Eye className="h-8 w-8 text-primary-600 mr-3" />
                  <div className="text-left">
                    <p className="font-medium text-gray-900">Preview Results</p>
                    <p className="text-sm text-gray-600">View normalized data</p>
                  </div>
                </button>
                
                <button
                  onClick={() => setActiveTab('history')}
                  className="flex items-center justify-center p-4 border-2 border-dashed border-gray-300 rounded-lg hover:border-primary-500 hover:bg-primary-50 transition-colors"
                >
                  <RotateCcw className="h-8 w-8 text-primary-600 mr-3" />
                  <div className="text-left">
                    <p className="font-medium text-gray-900">View History</p>
                    <p className="text-sm text-gray-600">Process audit trail</p>
                  </div>
                </button>
              </div>
            </div>

            {/* Process Flow */}
            <div className="bg-white rounded-lg shadow p-6">
              <h2 className="text-xl font-semibold text-gray-900 mb-4">Normalization Process Flow</h2>
              <div className="flex items-center justify-center space-x-8">
                <div className="text-center">
                  <div className="w-16 h-16 bg-blue-100 rounded-full flex items-center justify-center mx-auto mb-2">
                    <Database className="h-8 w-8 text-blue-600" />
                  </div>
                  <p className="text-sm font-medium text-gray-900">Raw Data</p>
                  <p className="text-xs text-gray-600">Phase 1 Analysis</p>
                </div>
                
                <div className="text-blue-400">→</div>
                
                <div className="text-center">
                  <div className="w-16 h-16 bg-green-100 rounded-full flex items-center justify-center mx-auto mb-2">
                    <FileText className="h-8 w-8 text-green-600" />
                  </div>
                  <p className="text-sm font-medium text-gray-900">Normalize Names</p>
                  <p className="text-xs text-gray-600">Clean statute names</p>
                </div>
                
                <div className="text-green-400">→</div>
                
                <div className="text-center">
                  <div className="w-16 h-16 bg-purple-100 rounded-full flex items-center justify-center mx-auto mb-2">
                    <Settings className="h-8 w-8 text-purple-600" />
                  </div>
                  <p className="text-sm font-medium text-gray-900">Clean Structure</p>
                  <p className="text-xs text-gray-600">Standardize schema</p>
                </div>
                
                <div className="text-purple-400">→</div>
                
                <div className="text-center">
                  <div className="w-16 h-16 bg-orange-100 rounded-full flex items-center justify-center mx-auto mb-2">
                    <FileText className="h-8 w-8 text-orange-600" />
                  </div>
                  <p className="text-sm font-medium text-gray-900">Sort Alphabetically</p>
                  <p className="text-xs text-gray-600">Organize data</p>
                </div>
              </div>
            </div>
          </div>
        );
      
      case 'normalization':
        return <DatabaseNormalization onStatusUpdate={fetchNormalizationStatus} />;
      case 'statute-names':
        return <StatuteNameNormalizer />;
      case 'structure':
        return <StructureCleaner />;
      case 'sorting':
        return <SortingInterface />;
      case 'progress':
        return <ProgressTracker />;
      case 'results':
        return <ResultsPreview />;
      case 'history':
        return <NormalizationHistory />;
      default:
        return <div>Select a tab to get started</div>;
    }
  };

  return (
    <div className="space-y-6">
      {/* Header */}
      <div className="bg-white rounded-lg shadow p-6">
        <div className="flex items-center justify-between">
          <div>
            <h1 className="text-3xl font-bold text-gray-900">Phase 2: Database Normalization</h1>
            <p className="text-gray-600 mt-2">
              Clean, standardize, and organize your statute data for better analysis and processing
            </p>
          </div>
          <div className="flex items-center space-x-3">
            <button
              onClick={fetchNormalizationStatus}
              className="inline-flex items-center px-4 py-2 border border-gray-300 rounded-md shadow-sm text-sm font-medium text-gray-700 bg-white hover:bg-gray-50 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-primary-500"
            >
              <RotateCcw className="h-4 w-4 mr-2" />
              Refresh Status
            </button>
          </div>
        </div>
      </div>

      {/* Navigation Tabs */}
      <div className="bg-white rounded-lg shadow">
        <div className="border-b border-gray-200">
          <nav className="-mb-px flex space-x-8 px-6" aria-label="Tabs">
            {tabs.map((tab) => (
              <button
                key={tab.id}
                onClick={() => handleTabChange(tab.id)}
                className={`py-4 px-1 border-b-2 font-medium text-sm ${
                  activeTab === tab.id
                    ? 'border-primary-500 text-primary-600'
                    : 'border-transparent text-gray-500 hover:text-gray-700 hover:border-gray-300'
                }`}
              >
                <div className="flex items-center">
                  <tab.icon className="h-5 w-5 mr-2" />
                  {tab.name}
                </div>
              </button>
            ))}
          </nav>
        </div>
        
        {/* Tab Content */}
        <div className="p-6">
          {renderTabContent()}
        </div>
      </div>
    </div>
  );
};

export default Phase2;
